import React from "react";

import Card from './Card';
import Sdata from './Sdata';
const FavS='Netflix'

const favseries=()=>{

    if(Favs==='Netflix'){
        return <Netflix/>
}else{
    return <Amazon/>
    
}

}



const App=()=>(
    <>
    <h1 className="heading_style">Top 5 netflix series</h1>
    {Sdata.map((val)=>{
        return(
            <Card
            key={val.id}
            imgsrc={val.imgsrc}
            title={val.title}
            sname={val.sname}
            link={val.link} 

            />
        );
    })}
    </>
);

export default App;
